import React, { useState } from "react";
import axios from 'axios';
import logo from "../logo.png"
import { useNavigate } from "react-router-dom";


export const Cabecera = () => {
    const navigate = useNavigate();

    const CerrarSesion = ()=> {
        console.log("cerrar sesion")
        localStorage.removeItem('user');
        navigate("/");
    }

    return (
    <div>
        <nav className="navbar navbar-expand-lg   ">
        <img src={logo} className="fotoCabecera"/>

            <div className="container-fluid bg-body-tertiary">
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className=" navbar-collapse collapse  " id="navbarNavAltMarkup">
                    <div className="navbar-nav ">
                        <a className="nav-link  text-white" href="/explorador">Explorador</a>
                        <a className="nav-link text-white" href={`/areaPersonal/${localStorage.getItem('user')}`}>Area Personal</a>
                    </div>
                </div>
                    <button onClick={CerrarSesion} className="buttonEdit bg-body-tertiary">Cerrar sesion</button>
            </div>
        </nav>
        </div>
    )
}
